INSERT INTO `posts` (`posts_id`, `posts_title`, `posts_description`, `posts_image`, `posts_published_date`, `posts_is_published`, `posts_category_category_id`, `user_user_id`, `posts_input_date`, `posts_last_update`) VALUES
(2, 'Tata Cara Presensi', '<p>1. Pastikan Menggunakan Browser Mozilla Firefox atau Chrome</p>\r\n<p>2. Pastikan Jam dan Tanggal Dikomputer Anda Sesuai</p>\r\n<p>3. Scan NIP Barcode Yang Ada Di ID Card Peserta</p>', 'http://10.234.159.200/uploads/pres.jpg', '2015-11-22 17:00:00', 0, NULL, 1, '2015-11-23 00:49:23', '2015-12-14 00:22:28'),
(3, 'Tata Cara Login Peserta', '<p>1. Silahkan Login di Menu sebelah kanan dengan menggunakan NIP dan Password</p>\r\n<p>2. Password awal adalah sama dengan NIP silahkan di ganti di profil</p>\r\n<p>3. Dilarang memberitahukan password kepada siapapun</p>', 'http://10.234.159.200/uploads/icon_login.png', '2015-12-13 17:00:00', 1, NULL, 1, '2015-11-23 00:54:04', '2015-12-14 00:24:34'),
(4, 'Tata Cara Registrasi Prakerin Baru', '<p>1. Silahkan Klik pendaftaran dan isi data pribadi dengan sesuai</p>\r\n<p>2. Tunggu Konfirmasi dari Administrator untuk di approve dan mendapatkan NIP</p>\r\n<p>3. Silahkan Login untuk mengetahui NIP dengan menggunakan username yang dibuat</p>', 'http://10.234.159.200/uploads/url.png', '2015-11-22 17:00:00', 0, NULL, 1, '2015-11-23 00:59:09', '2015-12-14 00:20:38'),
(5, 'Surat Keterangan Prakerin', '<p>Bagi yang akan selesai masa prakerinnya mohon info ke bagian personalia H-1 untuk dibuatkan surat keterangan magangnya, dan syaratnya presensinya harus sudah 66 hari kerja.</p>\r\n<p>Terima kasih</p>\r\n<p>Achyar Anshorie</p>', 'http://10.234.159.200/uploads/CERTIFICATES-ICON.jpg', '2015-12-13 17:00:00', 1, NULL, 1, '2015-12-14 00:20:27', '2015-12-14 00:20:27');
